;; **
;;; ### Approximating non-analytic functions
;;; 
;;; Let's try to approximate @@e^x@@ now. We didn't have terribly much success before, but we were using (poor) independent proposals.
;; **

;; @@
(def inputs-exp (range -5 5 1))
(def outputs-exp (mapv exp inputs-exp))


(time 
  (def samples-exp 
    (->> (doquery :lmh induce-procedure [inputs-exp outputs-exp])
         (drop 5000)
         (take 5000)
         (doall))))
